      {ideas && ideas.map((idea) => {
        return(


          <Idea
          ideas={ideas} deleteIdea={deleteIdea} editIdea={editIdea}

          // key={idea.id} 
          // idea={idea} 
          // deleteIdea={deleteIdea} 
          // editIdea={editIdea}
          />

        );
      })}
    </div>
  );
};

export default IdeaList;
